import {Modal} from 'reactstrap';

const customStyles = {
    content: {
      top: '50%',
      left: '50%',
      right: 'auto',
      bottom: 'auto',
      marginRight: '-50%',
      transform: 'translate(-50%, -50%)',
      maxWidth:"250px",
      width: "100%",
      padding: "50px",
      fontSize: "20px"
    },  
  };

export const TimeoutWarningModal = ({isOpen, onRequestClose}) => {  
    const onCancel = () => {
      // Implement your logout functionality here
      window.location.href = "http://localhost:9000/"
    }
  
    return (
      <div> 
        <Modal
          isOpen={isOpen}
          style={customStyles}
          className="Modal"
        >
          <h2> 찾고 계시는 상품이 없으신가요?</h2>
          <div className='Modal'>
            <p>이런 키워드를 찾고 계시지는 않으세요?</p>
            <ul>
                <li>
                    비즈메카
                </li>
                <li>
                    오피스넷
                </li>
                <li>
                    랜선에듀
                </li>
                <li>
                    상권분석
                </li>
            </ul>
          </div>
          <br/>
          <button className="" onClick={onCancel}></button>
        </Modal>
      </div>  
    );
  }

export default TimeoutWarningModal;
